	(2, 89, 'WooCommerce', 'woocommerce@local.donaonca.com', '', '', '2018-11-13 21:26:50', '2018-11-13 23:26:50', 'O pagamento será efetuado no momento da entrega. Status do pedido alterado de Pagamento pendente para Processando.', 0, '1', 'WooCommerce', 'order_note', 0, 0),
