	(20, 2, '2018-10-12 00:32:38', '2018-10-12 03:32:38', '<p>I\'m surprised you had the courage to take the responsibility yourself.</p><p>I\'m getting too old for this sort of thing.</p><p>It is also the high-end model of the MacBook family and is currently produced with 13- and 15-inch screens, although a 17-inch version has been offered previously.</p><p>Caution! May contain Peanuts!</p><p>You weren\'t on any mercy mission this time.</p>', 'Soy Water', '<p>Caution! May contain Peanuts!</p>', 'publish', 'open', 'closed', '', 'soy-water', '', '', '2018-10-14 01:44:31', '2018-10-14 04:44:31', '', 0, 'http://local.donaonca.com/produto/soy-water/', 0, 'product', '', 0),
