	(26, 2, '2018-10-12 00:32:43', '2018-10-12 03:32:43', '<p>What good is a reward if you ain\'t around to use it?</p>', 'Player', '<p>What good is a reward if you ain\'t around to use it?</p><p></p>', 'publish', 'open', 'closed', '', 'player', '', '', '2018-10-14 01:44:03', '2018-10-14 04:44:03', '', 0, 'http://local.donaonca.com/produto/player/', 0, 'product', '', 0),
