	(34, 2, '2018-10-12 00:32:52', '2018-10-12 03:32:52', '<p></p><p>You weren\'t on any mercy mission this time.</p><p>The name Acme became popular for businesses by the 1920s, when alphabetized business telephone directories such as the Yellow Pages began to be widespread.</p><p>Besides, these are adult stemcells, harvested from perfectly healthy adults whom I killed for their stemcells.</p><p>In your time, yes, but nowadays shut up!</p><p></p><p>It\'s only a model.</p>', 'Brown Blue', '<p></p><p>The name Acme became popular for businesses by the 1920s, when alphabetized business telephone directories such as the Yellow Pages began to be widespread.</p>', 'publish', 'open', 'closed', '', 'brown-blue', '', '', '2018-10-14 01:43:23', '2018-10-14 04:43:23', '', 0, 'http://local.donaonca.com/produto/brown-blue/', 0, 'product', '', 0),
	(35, 2, '2018-10-12 00:32:53', '2018-10-12 03:32:53', '', 'Brown Blue', '', 'inherit', 'open', 'closed', '', 'brown-blue-2', '', '', '2018-10-12 00:32:53', '2018-10-12 03:32:53', '', 34, 'http://local.donaonca.com/?attachment_id=35', 0, 'attachment', 'image/png', 0),
	(36, 2, '2018-10-12 00:32:53', '2018-10-12 03:32:53', '<p>You mean it controls your actions?</p><p>Shut up and get to the point!</p><p>Why do you think that she is a witch?</p><p></p><p>I want to come with you to Alderaan.</p>', 'Prince', '<p>You mean it controls your actions?</p><p>I want to come with you to Alderaan.</p>', 'publish', 'open', 'closed', '', 'prince', '', '', '2018-10-14 01:43:14', '2018-10-14 04:43:14', '', 0, 'http://local.donaonca.com/produto/prince/', 0, 'product', '', 0),
